content='{
    "title": "The Headhunter's Challenge",
    "npc_dialogue": "Ah, greetings traveler! I am Anthony Anderson, a renowned hunter in these lands. I have heard of your skills in combat and I have a proposition for you. Deep within the treacherous lands of The Scraper lies a legendary revolver known as 'CHAOS'. This pistol is said to grant its wielder incredible headshot bonuses. Bring me this weapon as proof of your prowess, and you shall be rewarded handsomely.",
    "objective": "Travel to The Scraper located in Dogtown and retrieve the legendary revolver 'CHAOS'. Defeat any foes that stand in your way and bring the weapon back to Anthony Anderson.",
    "reward": "You will be rewarded with 'CHAOS', the legendary revolver with a +150% Headshot Damage Multiplier, +50% Armor Penetration, 0.5sec Charge Time, and +10% Bleeding Chance."
}'
